import {useEffect,useState} from 'react'



const Home = ()=>
{
    const [workouts,setWorkouts] = useState(null)
    useEffect(()=>{
        const fetchWorkouts = async()=>{
            const response = await fetch('/api/workouts')
            const json = await response.json()

            if(response.ok)
            {
                setWorkouts(json)
            }
        }


    },[])
    return(
        <div className="home">
            <h2>Home</h2>
        </div>
    )
}


export default Home
